import React from 'react';
import styles from 'styled-components';

const Form = styles.form`
    width: 80%;
    height: 80%;
`
const Input = styles.input`
    width: 100px;
    height: 20px;
    border: none;
    border-radius: 8px;
    background: #f2f2f2;
    box-shadow: 7px 7px 9px #d7d7d7, -7px -7px 9px #ffffff;
`

const PasswordInput = styles.input`
    width: 100px;
    height: 20px;
    border: none;
    border-radius: 8px;
    background: #f2f2f2;
    box-shadow: 7px 7px 9px #d7d7d7, -7px -7px 9px #ffffff;
`

function Login() {
    return (
        <div>
            <Form>
                <label htmlFor="">Username </label>
                <Input type="text"></Input>

                <label htmlFor="">Password </label>
                <PasswordInput type="text"></PasswordInput>
            </Form>
        </div>
    )
}

export default Login
